import React, { useContext, useState, useEffect } from 'react';

import PlayersList from '../components/PlayersList';
import './Players.css';
import { AuthContext } from '../../shared/context/auth-context';
import { MOCK_PLAYERS } from '../../util/MockPlayers';

const Players = () => {
  const [loadedPlaces, setLoadedPlaced] = useState(null);
  const auth = useContext(AuthContext);

  useEffect(() => {
    const rankPlayers = () => {
      MOCK_PLAYERS.sort(function (a, b) {
        return b.points - a.points;
      });

      MOCK_PLAYERS.forEach((player, index) => (player.ranking = index + 1));
      setLoadedPlaced(MOCK_PLAYERS);
    };
    rankPlayers();
  }, []);

  useEffect(() => {}, []);

  if (loadedPlaces) {
    loadedPlaces.sort(function (a, b) {
      return b.points - a.points;
    });
  }

  return <PlayersList items={loadedPlaces} />;
};

export default Players;
